    <script type="text/javascript" name="scripts/icarus_interface.js">
        $(function () {
            setInterfaceCoordinates();
            setupBtns();
            display();
            $('[data-toggle="tooltip"]').tooltip();
            menuOffsetY = $('#menu').offset().top;
            $(window).scroll(function(){
              if ($(this).scrollTop() > menuOffsetY) {
                  $('#menu').addClass('fixed');
              } else {
                  $('#menu').removeClass('fixed');
              }
            });
        });
        
        function setInterfaceCoordinates() {
            var scrollPos = $(document).scrollTop();
            baseOffsetY = baseOffsetY ? baseOffsetY : chart[0][0].getBoundingClientRect().top;
            var chartOffsetY = chart[0][0].getBoundingClientRect().top + scrollPos;
            mainOffsetY = main[0][0].getBoundingClientRect().top + scrollPos;
            extraOffsetY = chartOffsetY - baseOffsetY;
            if (itemsLayer)
                itemsLayer.style('top', itemSvgOffsetY + extraOffsetY);
            annotationsMainOffsetY = mainHeight + mainScale + spaceAfterMain;
            covMainOffsetY = drawCoverage ? (annotationsMainOffsetY +
                                    (featuresHidden ? 0 : spaceAfterTrack)) : annotationsMainOffsetY;
            if (!featuresMainHidden)
                covMainOffsetY += annotationsHeight;
            miniOffsetY = covMainOffsetY + spaceAfterTrack;
            annotationsMiniOffsetY = miniOffsetY + miniHeight + (featuresHidden ? 0 : spaceAfterTrack);
            covMiniOffsetY = annotationsMiniOffsetY + annotationsMiniHeight + spaceAfterTrack;
        
            var physCovBtnOffsetY = 25;
        
            hideBtnAnnotationsMiniOffsetY = annotationsMiniOffsetY + chartOffsetY;
            hideBtnAnnotationsMainOffsetY = annotationsMainOffsetY + chartOffsetY;
            hideBtnCoverageMiniOffsetY = covMiniOffsetY + chartOffsetY;
            hideBtnCoverageMainOffsetY = covMainOffsetY + chartOffsetY;
            hideBtnPhysicalMiniCoverageOffsetY = hideBtnCoverageMiniOffsetY + physCovBtnOffsetY;
            hideBtnPhysicalCoverageOffsetY = hideBtnCoverageMainOffsetY + physCovBtnOffsetY;
        }
        
        function setupBtns() {
            if (!featuresHidden) addAnnotationsTrackButtons();
            if (drawCoverage) {
                addCovTrackButtons();
                if (typeof physical_coverage_data !== 'undefined')
                    addPhysicalCovTrackButtons();
                addCoverageButtons();
            }
            moveExpandBtns();
        }
        
        function setupInterface() {
            document.getElementById('left').onclick=function() {
                keyPress('left', 1) };
            document.getElementById('left_shift').onclick=function() {
                keyPress('left', 5) };
            document.getElementById('right').onclick=function() {
                keyPress('right', 1) };
            document.getElementById('right_shift').onclick=function() {
                keyPress('right', 5) };
            document.getElementById('zoom_in').onclick=function() {
                keyPress('zoom_in', 25) };
            document.getElementById('zoom_in_5').onclick=function() {
                keyPress('zoom_in', 40) };
            document.getElementById('zoom_out').onclick=function() {
                keyPress('zoom_out', 50) };
            document.getElementById('zoom_out_5').onclick=function() {
                keyPress('zoom_out', 200) };
        
            document.getElementById('input_coords_start').onkeydown=function(event) {
                enterCoords(event, this, 0);
            };
            document.getElementById('input_coords_end').onkeydown=function(event) {
                enterCoords(event, this, 1);
            };
            if (document.getElementById('input_contig_threshold')) {
                document.getElementById('input_contig_threshold').value = minContigSize;
                document.getElementById('input_contig_threshold').onkeyup = function(event) {
                    setContigSizeThreshold(event, this) };
            }
        
            setupAutocompleteSearch();
        
            setupChromosomeSelector(document.getElementById('select_chr_start'), 0);
            setupChromosomeSelector(document.getElementById('select_chr_end'), 1);
        
            var checkboxes = document.getElementsByName('misassemblies_select');
            for(var i = 0; i < checkboxes.length; i++) {
                checkboxes[i].addEventListener('change', function(){
                    showMisassemblies();
                });
            }
            window.onresize = function(){ location.reload(); };
            display();
        }
        
        function keyPress (cmd, deltaCoeff) {
            var ext = brush.extent();
            var delta = .01 * (ext[1] - ext[0]);
            if (deltaCoeff) delta *= deltaCoeff;
            delta = Math.max(1, delta);
            switch (cmd) {
                case 'zoom_in':
                    if (ext[1] - ext[0] - 2 * delta > minBrushExtent)
                        brush.extent([ext[0] + delta, ext[1] - delta]);
                    break;
                case 'zoom_out':
                    brush.extent([ext[0] - delta, ext[1] + delta]);
                    break;
                case 'left':
                    if (ext[0] > genomeStartPos) brush.extent([ext[0] - delta, ext[1] - delta]);
                    break;
                case 'right':
                    if (ext[1] < x_mini.domain()[1]) brush.extent([ext[0] + delta, ext[1] + delta]);
                    break;
                case 'esc': {
                    info.selectAll('p')
                        .remove();
                    info.selectAll('span')
                        .remove();
                    addClickContigText(info);
                    setBaseChartHeight();
                    arrows = [];
                    mini.selectAll('.arrow').remove();
                    mini.selectAll('.arrow_selected').remove();
                    removeTooltip();
                    selected_id = null;
                    break
                }
            }
            itemsContainer.select('.glow').remove();
            display();
        }
        
        function keyPressAnswer() {
            if (d3.event.target.className == 'textBox') return;
            var charCode = d3.event.which || d3.event.keyCode;
            var charStr = String.fromCharCode(charCode);
            if (d3.event.shiftKey) deltaCoeff = 5;
            else deltaCoeff = 1;
            var ext = brush.extent();
            if (charStr == '-' || charStr == '_') // -
                keyPress('zoom_out', deltaCoeff);
            else if (charStr == '+' || charStr == '=') // +
                keyPress('zoom_in', deltaCoeff);
        }
        
        function keyDownAnswer() {
            var key = d3.event.keyCode;
            if (d3.event.target.className == 'textBox') return;

            var ext = brush.extent();
            if (key == 39 && x_mini.domain()[1] - ext[0] > minBrushExtent) // >
                keyPress('right', deltaCoeff);

        }
        
        function getChromCoords(coord, coordIndex) {
            if (isContigSizePlot || chrContigs.length <= 1) {
                return coord;
            }
            else {
                var chrSelector = coordIndex == 0 ? document.getElementById('select_chr_start') : document.getElementById('select_chr_end');
                var prevLen = 0;
                for (var i = 0; i < chrContigs.length - 1; i++) {
                    chrName = chrContigs[i];
                    chrLen = chromosomes_len[chrName];
                    if (coord < prevLen + chrLen) {
                        break;
                    }
                    prevLen += chrLen;
                }
                chrSelector.value = i;
                coord -= prevLen;
                return coord;
            }
        }
        
        function trimChrNames(contigNames){
            //gi_77461965_ref_NC_007493.1__Rhodobacter_sphaeroides_2.4.1_chromosome_1__complete_sequence
            if (contigNames.length == 1)
                return contigNames;
            var ncbiPattern = /gi_.+__(.+__.+)/i;
            var trimmedNames = [];
            for (i = 0; i < contigNames.length; i++) {
                found = contigNames[i].match(ncbiPattern);
                if (found && found.length > 1)
                    trimmedNames.push(found[1]);
                else trimmedNames.push(contigNames[i]);
            }
            var sortedNames = trimmedNames.concat().sort();
            var s1 = sortedNames[0], s2 = sortedNames[sortedNames.length - 1];
            var maxIndex = s1.length;
            var commonStrings = [];
            var chrIndexInName = s1.indexOf('chromosome');
            if (chrIndexInName > -1)
                maxIndex = chrIndexInName;
            for (i = 0; i < s1.length; i++) {
                var j = i;
                while(j < maxIndex && s1.charAt(j)=== s2.charAt(j))
                    j++;
                commonStrings.push(s1.substring(i, j))
            }
            if (!commonStrings)
                return trimmedNames;
            var commonString = commonStrings.sort(function (a, b) { return b.length - a.length; })[0];
            if (commonString.length < 7)
                return trimmedNames;
            var shortNames = [];
            for (i = 0; i < trimmedNames.length; i++) {
                splittedName = trimmedNames[i].split(commonString);
                if (splittedName.length == 1)
                    shortNames.push(splittedName[0]);
                else if ((splittedName[0] + splittedName[1]).length < 30)
                    shortNames.push(splittedName[0] + '...' + splittedName[1]);
                else if (splittedName[1].length < 10)
                    shortNames.push(splittedName[0] + '...');
                else
                    shortNames.push('...' + splittedName[1]);
            }
            return shortNames;
        }

        function createAutocompleteListItems() {
            var autocompleteItems = [];
            for (var i = 0; i < items.length; i++) {
                if (isContigSizePlot && !items[i].fullContig)
                    continue;
                var position = [formatValue(items[i].start, mainTickValue), ndash, formatValue(items[i].end, mainTickValue), mainTickValue, ' '].join(' ');
                var description = '<span style="color:gray"> ' + items[i].assembly + ': </span>' + items[i].name;
                if (isContigSizePlot){
                    var size = items[i].size;
                    var tickValue = getTickValue(size);
                    size = formatValue(size, tickValue);
                    description +=  ' ' + size + ' ' + tickValue;
                }
                else {
                    description +=  ' ' + position;
                }
                autocompleteItems.push({
                    label: items[i].name,
                    value: 'contig,' + i,
                    desc: description
                })
            }
            if (featuresData) {
                for (var i = 0; i < featuresData.features.length; i++) {
                    var feature = featuresData.features[i];
                    var featureKind = feature.kind[0].toUpperCase() + feature.kind.slice(1);
                    var name = (feature.name ? ' ' + feature.name : '') + (feature.id_ ? ' ID=' + feature.id_ : '');
                    var label = featureKind + name + ' ' + chrContigs[feature.chr];
                    var position = [formatValue(feature.start, mainTickValue), ndash, formatValue(feature.end, mainTickValue), mainTickValue, ' '].join(' ');
                    var description = '<span style="color:gray">' + featureKind + ': </span>' + name + ' ' + chrContigs[feature.chr];
                    autocompleteItems.push({
                        label: label + ' ' + chrContigs[feature.chr],
                        value: 'gene,' + i,
                        desc: description
                    })
                }
            }
            return autocompleteItems;
        }

        function getCoords(textBox, coordIndex, selectedIndex) {
            var coord = textBox.value;
            if (!isContigSizePlot && chrContigs.length > 1) {
                var chrSelector = coordIndex == 0 ? document.getElementById('select_chr_start') : document.getElementById('select_chr_end');
                var selectedContig = selectedIndex ? parseInt(selectedIndex) : chrSelector.options[chrSelector.selectedIndex].value;
                var selectedName = chrContigs[selectedContig];
                var prevLen = 0;
                for (var i = 0; i < selectedContig; i++) {
                    chrName = chrContigs[i];
                    chrLen = chromosomes_len[chrName];
                    prevLen += chrLen;
                }
                if (parseInt(coord)) {
                    coord = Math.min(parseInt(coord) + prevLen, chromosomes_len[selectedName] + prevLen - 1);
                }
            }
            return coord;
        }
        
        var timerAnimationSetCoords;
        
        function setCoords(coords, animation) {
            var ext = brush.extent();
            var startCoord = ext[0], endCoord = ext[1];
            if (coords.length >= 2 && parseInt(coords[0]) <= parseInt(coords[1])) {
                startCoord = parseInt(coords[0]);
                endCoord = Math.max(parseInt(coords[1]), startCoord + 5);
            }
            else if (coords.length == 1 && parseInt(coords[0])) {
                startCoord = parseInt(coords[0]);
                var brushSize = ext[1] - ext[0];
                endCoord = startCoord + brushSize;
            }
            startCoord = Math.max(0, startCoord);
            endCoord = Math.min(endCoord, x_mini.domain()[1]);
            startCoord = Math.min(startCoord, endCoord - minBrushExtent);
            clearInterval(timerAnimationSetCoords);
            if (animation) {
                var distance = Math.abs(startCoord - ext[0]);
                if (distance < 5) return;
                var distRange = distance / (ext[1] - ext[0]);
                if (distRange < 0.5) {
                    brush.extent([startCoord, endCoord]);
                    display();
                    return
                }
                if (distRange > 50) {
                    distRange = distRange * 0.05;
                    var zoomDelta = (distRange - 1) * .5 * 100;
                    brush.extent([ext[0] - zoomDelta, ext[1] + zoomDelta]);
                }
                var delta = Math.max(5, 0.05 * distance);
                ext = brush.extent();
                var numSteps = Math.max(1, parseInt(distance / delta));
                if (ext[0] > startCoord) delta = -delta;
                delta = (startCoord - ext[0]) / numSteps;
                timerAnimationSetCoords = setInterval(function() {
                    ext = [ext[0] + delta, ext[1] + delta];
                    if ((delta > 0 && ext[0] >= startCoord) || (delta < 0 && ext[0] <= startCoord)) {
                        clearInterval(timerAnimationSetCoords);
                        brush.extent([startCoord, endCoord]);
                        display();
                        return;
                    }
                    brush.extent(ext);
                    display();
                }, 5)
            }
            else {
                brush.extent([startCoord, endCoord]);
                display();
            }
        }

        function getItemStrokeWidth(block, selected_id) {

                x += block.groupId == selected_id ? 1 : .5;

        function getYForExpandedLanes(block) {

        var ndash = String.fromCharCode(8211);
        
        function appendBlock(whereAppendBlock, numBlock, curBlock, selectedBlock, prevBlock, prevChr, isExpanded) {

            var hasChromosomeLinks = typeof links_to_chromosomes !== 'undefined';

        function formatPosition(start, end, tickValue){

        function showArrows(block) {

            mini.selectAll('.arrow').remove();

        function showMisassemblies() {
            for (var numItem = 0; numItem < items.length; numItem++) {
                if (items[numItem].misassemblies) {
                    items[numItem] = changeMisassembledStatus(items[numItem]);
                    if (items[numItem].triangles && items[numItem].triangles.length > 0)
                        for (var i = 0; i < items[numItem].triangles.length; i++) {
                            if (!items[numItem].triangles[i].objClass) items[numItem].triangles[i].objClass = "misassembled";
                            items[numItem].triangles[i] = changeMisassembledStatus(items[numItem].triangles[i]);
                        }
                }
            }
            hideUncheckedMisassemblies(itemsContainer);
            hideUncheckedMisassemblies(chart);
        }
        
        function changeMisassembledStatus(block) {
            var msTypes = block.misassemblies.split(';');
            var isMisassembled = "False";
            for (var i = 0; i < msTypes.length; i++) {
                if (msTypes[i] && document.getElementById(msTypes[i]).checked) isMisassembled = "True";
            }
            if (isMisassembled == "True" && block.misassembled == "False") {
                block.objClass = block.objClass.replace("disabled", "misassembled");
            }
            else if (isMisassembled == "False")
                block.objClass = block.objClass.replace(/\bmisassembled\b/g, "disabled");
            block.misassembled = isMisassembled;
            return block;
        }
        
        function hideUncheckedMisassemblies(track) {
            track.selectAll('.block')
                .classed('misassembled', function (block) {
                    if (block && block.misassemblies) {
                        if (block.misassembled) return block.misassembled == 'True';
                        return checkMsTypeToShow(block);

                .classed('misassembled', function (block) {
                    if (block && block.misassemblies)

                .classed('disabled', function (block) {
                    if (block && block.misassemblies)

        function checkMsTypeToShow(block) {

        function addTooltipTspan(displayedText, tspan, width) {
            var visibleLabel = getVisibleText(displayedText, width);
            if (visibleLabel.length < displayedText.length) {
                var fullName = displayedText;
                tspan.on('mouseover',function(d) {
                    addTooltip(d, '<span class="lane_tooltip">' + fullName + '</span>');
                });
                tspan.on('mouseout',function(d) {
                    removeTooltip();
                });
                displayedText = visibleLabel;
            }
            return displayedText
        }
        
        function wrap(text, width, cutText, addStdoutLink, offsetX, separator) {
            var stdoutLinkWidth = getSize('(text)') + 10;
            text.each(function() {
                var text = d3.select(this),
                    words = text.text().split(separator).reverse(),
                    word,
                    line = [],
                    lineNumber = 0,
                    lineHeight = 1.1,
                    y = text.attr('y'),
                    dy = parseFloat(text.attr('dy')),
                    tspan = text.text(null).append('tspan').attr('x', addStdoutLink ? -stdoutLinkWidth : offsetX)
                        .attr('y', y).attr('dy', dy + 'em')
                        .style('font-weight', 'bold');
                var firstLine = true;
                while (word = words.pop()) {
                    line.push(word);
                    var displayedText = line.join(' ');
                    tspan.text(displayedText);
                    var doCut = firstLine && cutText;
                    if ((tspan.node().getComputedTextLength() > width || doCut) && line.length > 1) {
                        line.pop();
                        displayedText = line.join(' ');
                        displayedText = doCut ? addTooltipTspan(line[0], tspan, width) : displayedText;
                        tspan.text(displayedText);
                        line = [word];
                        if (firstLine && addStdoutLink) {
                            linkAdded = true;
                            tspan = text.append('tspan')
                                .attr('x', offsetX)
                                .attr('y', y)
                                .attr('dy', lineNumber * lineHeight + dy + 'em')
                                .attr('text-decoration', 'underline')
                                .attr('fill', '#0000EE')
                                .style("cursor", "pointer")
                                .text('(text)')
                                .on('click',function(d) {
                                    window.open(d.link, '_blank');
                                    d3.event.stopPropagation();
                                });
                        }
                        firstLine = false;
                        if (word.search("\\+") != -1) {
                            tspan = text.append('tspan')
                                .attr('x', offsetX)
                                .attr('y', y)
                                .attr('dy', ++lineNumber * lineHeight + dy + 'em')
                                .text(word);
                            var msWords = word.split('+');
                            var misassemblies = msWords[0];
                            var extMisassemblies = misassemblies.split(' ')[1];
                            var localMisassemblies = msWords[1];
                            var msTooltip = extMisassemblies + ' extensive + ' + localMisassemblies + ' local misassemblies';
                            tspan.on('mouseover',function(d) {
                                addTooltip(d, '<span class="lane_tooltip">' + msTooltip + '</span>');
                            });
                            tspan.on('mouseout',function(d) {
                                removeTooltip();
                            });
                        }
                        else {
                            tspan = text.append('tspan')
                                .attr('x', offsetX)
                                .attr('y', y)
                                .attr('dy', ++lineNumber * lineHeight + dy + 'em')
                                .text(word);
                        }
                    }
                    else if (doCut) {
                        displayedText = addTooltipTspan(line[0], tspan, width);
                        tspan.text(displayedText);
                    }
                }
            });
        }
        
        function getCoordsFromURL() {
            var query = document.location.search;
            query = query.split('+').join(' ');
        
            var params = {},
                tokens,
                re = /[?&]?([^=]+)=([^&]*)/g;
        
            while (tokens = re.exec(query)) {
                params[decodeURIComponent(tokens[1])] = decodeURIComponent(tokens[2]);
            }
            if (params && params.assembly && params.contig && params.start && params.end) {
                var delta = 1000;
                setCoords([parseInt(params.start) - delta, parseInt(params.end) + delta]);
                for (var i = 0; i < items.length; i++) {
                    if (items[i].assembly == params.assembly && items[i].name == params.contig &&
                        items[i].corr_start == params.start && items[i].corr_end == params.end) {
                        selected_id = items[i].groupId;
                        showArrows(items[i]);
                        changeInfo(items[i]);
                        display();
                        break;
                    }
                }
            }
            return params;
        }
        
        function getText(textItem, minExtent, maxExtent) {
            if (!textItem.name && !textItem.label) return;
            var drawLimit = letterSize * 3;
            if (textItem.label) {
                return getVisibleText(textItem.label, visibleLength);
            }
            var visibleLength = getItemWidth(textItem, minExtent, maxExtent) - 20;
            if (visibleLength > drawLimit)
                return getVisibleText(textItem.name, visibleLength, textItem.len);
        }
        
        function addTooltip(feature, tooltipText, event) {

                (feature.id ? ' ID=' + feature.id + ',' : '') + ' coordinates: ' + feature.start + '-' + feature.end + '</span>' : '';
            var eventX = event ? event.pageX : d3.event.pageX - 50;
            var eventY = event ? event.pageY + 5 : d3.event.pageY + 5;
            if (tooltipText && featureTip.html() != tooltipText) {
                featureTip.style('opacity', 1);
                featureTip.html(tooltipText)
                    .style('left', eventX + 'px')
                    .style('top', eventY + 'px');

        function getTickValue(value) {
            if (value > 1000000000)
                return 'Gbp';
            else if (value > 1000000)
                return 'Mbp';
            else if (value > 1000)
                return 'kbp';
            else
                return 'bp';
        }
        
        function formatValue(d, tickValue) {
            d = Math.round(d);
            if (tickValue == 'Gbp')
                return d3.round(d / 1000000000, 2);
            else if (tickValue == 'Mbp')
                return d3.round(d / 1000000, 2);
            else if (tickValue == 'kbp')
                return d3.round(d / 1000, 2);
            else
                return d;
        }
        
        function getTextSize(text, size) {

        }
        
        function getVisibleText(fullText, l, lenChromosome) {
            var t = '';
            if ((fullText.length - 1) * letterSize > l) {
                t = fullText.slice(0, fullText.length - 1);
                while ((t.length - 1) * letterSize > l && t.length > 3) {
                    t = fullText.slice(0, t.length - 1);
                }
            }
            else t = fullText;
            if (lenChromosome && t.length == fullText.length) {
                var t_plus_len = fullText + ' (' + lenChromosome + ' bp)';
                if ((t_plus_len.length - 2)* letterSize <= l) return t_plus_len;
            }
            return (t.length < fullText.length && t.length <= 3 ? '' : t + (t.length >= fullText.length ? '' : '...'));
        }
        
        function getSize(text) {
            var tmp = document.createElement("span");
            tmp.innerHTML = text;
            tmp.style.visibility = "hidden";
            tmp.className = "itemLabel";
            tmp.style.whiteSpace = "nowrap";
            document.body.appendChild(tmp);
            size = tmp.offsetWidth;
            document.body.removeChild(tmp);
            return size;
        }

        function addGradient(d, marks, gradientExists, smoothGradient) {
            if (!marks) return;
            var gradientId = 'gradient' + d.id;
            marks = marks.split(', ');
            if (marks.length == 1) return contigsColors[marks[0]];
            if (gradientExists) return 'url(#' + gradientId + ')';
            var gradient = chart.append("svg:defs")
                .append("svg:linearGradient")
                .attr("id", gradientId);
            if (!smoothGradient){
                gradient.attr("x1", "0%")
                    .attr("y1", "0%")
                    .attr("x2", "0%")
                    .attr("y2", "100%");
                gradientSteps = ["50%", "50%"];
                for (var m = 0; m < marks.length; m++)
                    gradient.append("svg:stop")
                        .attr("offset", gradientSteps[m])
                        .attr("stop-color", contigsColors[marks[m]])
                        .attr("stop-opacity", 1);
            }
            else {
                gradient.attr("x1", "0%")
                        .attr("y1", "0%")
                        .attr("x2", "100%")
                        .attr("y2", "100%");
                var colors = [];
                for (var m = 0; m < marks.length; m++)
                    colors.push(contigsColors[marks[m]])
                var colorScale = d3.scale.linear().range(colors);
                gradient.selectAll("stop")
                        .data(colorScale.range())
                        .enter().append("stop")
                        .attr("offset", function(d,i) { return i / (colorScale.range().length - 1); })
                        .attr("stop-color", function(d) { return d; });
            }
        
            return 'url(#' + gradientId + ')';
        }
        
        function getNextMaxCovValue(maxY, ticksVals) {

            var avgCoverage = coverageSum / covDots;

                if (!cov_line) break;
                cov_lines.push(cov_line);

            if (nextPos < lastPos) {

        function appendXAxis(lane, scale, laneHeight, tickValue) {

            function parseData (data) {

            function getBreakpointLines() {
                var lines = [];
                var contigStart = true;
                var prev_pos = 0;
                var fullsizeBlock = false;
                for (var i = 0; i < items.length; i++) {
                	block = items[i];
                    if (block.notActive) {
                        if (block.size - (block.corr_end - block.corr_start) < 5) {
                            fullsizeBlock = true;
                            continue;
                        }
                        fullsizeBlock = false;
                    	y = y_main(block.lane) + .25 * lanesInterval + 10;
                    	if (!contigStart) {
                            var linePos = block.start_in_contig < block.end_in_contig ? block.corr_start : block.corr_end;
                    		if (Math.abs(prev_pos - linePos) > 2) {
                                if (block.mstype != "indel")
                                    lines.push({pos: linePos, y: y, type: block.mstype});
                    		}
                    	}
                    	else contigStart = false;
                    	prev_pos = block.corr_end;
                        if (block.mstype != "indel")
                    	    lines.push({pos: block.corr_end, y: y, type: block.mstype});
                    }
                    else {
                    	contigStart = true;
                        if (!fullsizeBlock) lines.pop();
                    }
                }
                return lines;
            }
        
            function isOverlapping (block, lane) {
                if (lane)
                    for (var i = 0; i < lane.length; i++)
                        if (block.corr_start <= lane[i].corr_end && lane[i].corr_start <= block.corr_end)
                            return true;
        
                return false;
            }
        
            function addAssemblyDescription (lanes) {

                        description += 'contigs: ' + assemblies_contigs[assemblyName] + '\n';
                        if (!isContigSizePlot)
                            description += 'misassemblies: ' + assemblies_misassemblies[assemblyName];
                        else
                            description += 'N50: ' + assemblies_n50[assemblyName];
                        lanes[laneNum].description = description;
                        if (!isContigSizePlot)
                            lanes[laneNum].link = assemblies_links[assemblyName];
                    }
                }
                return lanes;
            }
        
            function collapseLanes (chart) {
                var lanes = [], items = [], laneId = 0, itemId = 0, groupId = 0;
        
                function parseItem(block, fullInfo, misassembly) {
                    block.misassembledEnds = '';
                    block.lane = laneId;
                    block.id = itemId;
                    block.groupId = groupId;
                    block.assembly = assemblyName;
                    if (isContigSizePlot) {
                        if (!fullInfo) {
                            block.corr_start = currentLen;
                            currentLen += block.size;
                            block.corr_end = currentLen;
                            block.fullContig = true;
                        }
                        else {
                            block.start_in_ref = block.corr_start;
                            block.end_in_ref = block.corr_end;
                    	    start_in_contig = Math.min(block.start_in_contig, block.end_in_contig);
                    	    end_in_contig = Math.max(block.start_in_contig, block.end_in_contig);
                            block.corr_start = currentLen + start_in_contig - 1;
                            block.corr_end = currentLen + end_in_contig;
                            block.notActive = true;
                            block.contig_type = fullInfo.contig_type;
                            block.mstype = misassembly ? misassembly.mstype : null;
                        }
                    }
                    var nonOverlappingLaneId = 0;
                    var blockSize = block.corr_end - block.corr_start;
                    var minOverlap = Math.min(500, blockSize * 0.1);
                    if (!isContigSizePlot) {
                        for (var nonOverlappingLaneId = 0; nonOverlappingLaneId < lastPosInLanes.length; nonOverlappingLaneId++){
                            if (lastPosInLanes[nonOverlappingLaneId] - block.corr_start < Math.min(minOverlap, lastBlockSizesInLanes[nonOverlappingLaneId] * 0.1))
                                break;
                        }
                        block.nonOverlappingLane = nonOverlappingLaneId;
                        if (nonOverlappingLaneId >= lastPosInLanes.length) {
                            lastPosInLanes.push(block.corr_end);
                            lastBlockSizesInLanes.push(blockSize);
                        }
                        else {
                            if (block.corr_end > lastPosInLanes[nonOverlappingLaneId]) {
                                lastPosInLanes[nonOverlappingLaneId] = block.corr_end;
                                lastBlockSizesInLanes[nonOverlappingLaneId] = blockSize;
                            }
                            else {
                                lastPosInLanes[nonOverlappingLaneId] = lastPosInLanes[nonOverlappingLaneId];
                            }
                        }
                    }
                    block.triangles = Array();
                    itemId++;
                    numItems++;
                    var structure = getBlockStructure(block);
                    if (block.genes) {
                        genePrediction = true;
                        var corr_start = block.corr_start;
                        if (block.contig_type != 'ambiguous' && structure && structure.length > 0)
                            corr_start =  structure[0].corr_start;
                        for (var gene_n = 0; gene_n < block.genes.length; gene_n++) {
                            if (!block.genes[gene_n].corr_start) {
                                block.genes[gene_n].corr_start = Math.max(block.genes[gene_n].start + corr_start, block.corr_start);
                                block.genes[gene_n].corr_end = Math.min(block.genes[gene_n].end + corr_start, block.corr_end);
                            }
                            block.genes[gene_n].groupId = block.groupId;
                            block.genes[gene_n].lane = block.lane;
                            block.genes[gene_n].nonOverlappingLane = block.nonOverlappingLane;
                            block.genes[gene_n].objClass = 'gene predicted_gene';
                            block.genes[gene_n].notActive = true;
                        }
                    }
                    if (block.mis_ends && misassembled_ends) {
                        for (var num = 0; num < misassembled_ends.length; num++) {
                            if (!misassembled_ends[num]) continue;
                            var triangleItem = {};
                            triangleItem.name = block.name;
                            triangleItem.corr_start = block.corr_start;
                            triangleItem.corr_end = block.corr_end;
                            triangleItem.assembly = block.assembly;
                            triangleItem.id = itemId;
                            triangleItem.lane = laneId;
                            triangleItem.nonOverlappingLane = block.nonOverlappingLane;
                            triangleItem.groupId = groupId;
                            triangleItem.misassembledEnds = misassembled_ends[num];
                            triangleItem.misassemblies = block.misassemblies.split(';')[num];
                            block.triangles.push(triangleItem);
                            itemId++;
                            numItems++;
                        }
                    }
                    return block
                }
        
                for (var assemblyName in chart.assemblies) {
                    var lane = chart.assemblies[assemblyName];
                    var currentLen = 0;
                    var numItems = 0;
                    var lastPosInLanes = [];
                    var lastBlockSizesInLanes = [];
                    var laneItems = [];
                    for (var i = 0; i < lane.length; i++) {
                        var block = lane[i];
                        if (block.mis_ends) var misassembled_ends = block.mis_ends.split(';');
                        if (isContigSizePlot) {
                            var blocks = getBlockStructure(block);
                            if (blocks) {
                                for (var k = 0; k < blocks.length; k++) {
                                    var misassembly = (k < blocks.length - 1 && blocks[k + 1].contig_type == 'M') ? blocks[k + 1] : null;
                                    if (blocks[k].contig_type != 'M' && block.contig_type != 'ambiguous')
                                        laneItems.push(parseItem(blocks[k], block, misassembly));
                                    if (block.contig_type == 'ambiguous') {
                                        blocks[k].start_in_ref = blocks[k].corr_start;
                                        blocks[k].end_in_ref = blocks[k].corr_end;
                                    }
                                }
                            }
                        }
                        var newItem = parseItem(block);
                        if (!block.is_best) {
                            newItem.best_group = getBlockStructure(block);
                            newItem.structure = null;
                        }
                        laneItems.push(newItem);
                        groupId++;
                    }
                    for (var i = 0; i < laneItems.length; i++) {
                        item = laneItems[i];
                        if (!isContigSizePlot) {
                            item.nonOverlappingLane = lastPosInLanes.length - item.nonOverlappingLane - 1;
                            if (item.triangles) {
                                for (var j = 0; j < item.triangles.length; j++) {
                                    item.triangles[j].nonOverlappingLane = lastPosInLanes.length - item.triangles[j].nonOverlappingLane - 1;
                                }
                            }
                            if (item.genes) {
                                for (var j = 0; j < item.genes.length; j++) {
                                    item.genes[j].nonOverlappingLane = lastPosInLanes.length - item.genes[j].nonOverlappingLane - 1;
                                }
                            }
                        }
                        items.push(item);
                    }
        
                    lanes.push({
                        id: laneId,
                        label: assemblyName,
                        maxLines: lastPosInLanes.length,
                        isExpanded: false,
                    });
                    laneId++;
                }
        
                addAssemblyDescription(lanes);
                return {lanes: lanes, items: items};
            }
        
            function setupCoverage() {
                numYTicks = 5;

                x_cov_mini_S = x_mini,      // x coverage scale
                y_max = typeof reads_max_depth !== 'undefined' ? Math.max(reads_max_depth[chromosome], physical_max_depth[chromosome]) :

                // draw main coverage

                    .orient('left')

                    })

                main_cov = chart.append('g')

                main_cov.attr('display', 'none');

                setYScaleLabels(mini_cov, y_cov_mini_A, y_cov_mini_S);

                appendPaths(mini_cov);
                appendPaths(main_cov);
                totalMaxYMini = y_max;
                totalMaxYMain = y_max;
                if (typeof physical_coverage_data !== 'undefined') {
                    drawCoverageLine(x_mini.domain()[0], x_mini.domain()[1], false, physical_coverage_data, '.phys_covered');
                    togglePhysCoverageMini();
                }
                drawCoverageLine(x_mini.domain()[0], x_mini.domain()[1], false, coverage_data, '.covered');
            }
        
            function appendPaths(track) {
                track.append('g')
                    .attr('class', 'phys_covered')
                    .append('path');
                track.append('g')
                    .attr('class', 'covered')
                    .append('path');
            }
        
            // generates a single path for each block class in the mini display
            // ugly - but draws mini 2x faster than append lines or line generator
            // is there a better way to do a bunch of lines as a single path with d3?
            function getMiniItems(items) {
                var result = [];
                var curLane = 0;
                var numItem = 0;
        
                var countSupplementary = 0;
                for (var c, i = 0; i < items.length; i++) {
                    block = items[i];
                    if (block.lane != curLane) {
                        numItem = 0;
                        countSupplementary = 0;
                    }
                    result.push(createMiniItem(block, curLane, numItem, countSupplementary));
                    curLane = block.lane;
                    if (!block.notActive) numItem++;
                    if (block.triangles && block.triangles.length > 0)
                        for (var j = 0; j < block.triangles.length; j++) {
                            result.push(createMiniItem(block.triangles[j], curLane, numItem, countSupplementary));
                            numItem++;
                            countSupplementary++;
                        }
                }
                return result;
            }
        
            function createMiniItem(block, curLane, numItem, countSupplementary) {
                var miniPathHeight = 10;
                var isSmall = x_mini(block.corr_end) - x_mini(block.corr_start) < miniPathHeight;
        
                block.misassembled = block.misassemblies ? "True" : "False";
                c = (block.misassembled == "False" ? "" : "misassembled");
                c += (block.similar && block.similar == "True" ? " similar" : "");
                if (block.more_unaligned && block.misassembled == "True") {
                    c = "mis_unaligned";
                    block.misassemblies = "";
                }
                else if (block.more_unaligned) {
                    c = "correct_unaligned";
                }
                if (block.ambiguous) c = "ambiguous";
                if (!block.is_best && block.ambiguous_alignments && block.ambiguous_alignments.length > 0) c = "alternative";
                //c += ((!block.misassembledEnds && !isSmall) ? " light_color" : "");
                if (INTERLACE_BLOCKS_COLOR) c += ((numItem - countSupplementary) % 2 == 0 ? " odd" : "");
                var text = '';
                if (isContigSizePlot) {
                    if (block.contig_type == "short_contigs") c += " disabled";
                    else if (block.contig_type == "correct") c += "";
                    else if (!block.contig_type) c += " unknown";
                    else c += " " + block.contig_type;
                }
        
                if (block.marks) {  // NX for contig size plot
                  var marks = block.marks;
                  text = marks;
                  marks = marks.split(', ');
                  for (var m = 0; m < marks.length; m++)
                    c += " " + marks[m].toLowerCase();
                }
        
                block.objClass = c;
                block.order = numItem - countSupplementary;
        
                var startX = block.misassembledEnds == "R" ? x_mini(block.corr_end) : x_mini(block.corr_start);
                var endX = x_mini(block.corr_end);
                var pathEnd = x_mini(block.corr_end);
                var startY = y_mini(block.lane) + .18 * miniLanesHeight;
                if (INTERLACE_BLOCKS_VERT_OFFSET) startY += offsetsMiniY[items[i].order % 3] * miniLanesHeight;
                var path = '';
                if (!isSmall) {
                    if (block.misassembledEnds == "L") path = ['M', startX, startY, 'L', startX + (Math.sqrt(3) * miniPathHeight / 2), startY + miniPathHeight / 2,
                      'L', startX, startY + miniPathHeight, 'L',  startX, startY].join(' ');
                    else if (block.misassembledEnds == "R") path = ['M', startX, startY, 'L', startX - (Math.sqrt(3) * miniPathHeight / 2), startY + miniPathHeight / 2,
                      'L', startX, startY + miniPathHeight, 'L',  startX, startY].join(' ');
                }
                return {objClass: block.objClass, path: path, misassemblies: block.misassemblies, misassembledEnds: block.misassembledEnds,
                    start: startX, end: endX, y: startY, size: block.size, text: text, id: block.id, contig_type: block.contig_type, fullContig: block.fullContig};
            }
        
            function parseFeaturesData(chr) {
              var lanes = [];
              var features = [];
              var data = [];
              var laneId = 0, itemId = 0;
        
              for (var numContainer = 0; numContainer < features_data.length; numContainer++) {
                  var lane = features_data[numContainer];
                  var numItems = 0;
                  var chrIndex = 0;
                  for (var i = 0; i < lane.length; i++) {
                      chrIndex = typeof references_by_id !== 'undefined' ? chrContigs.indexOf(references_by_id[lane[i].chr]) : lane[i].chr;
                      if (!oneHtml && chrIndex == -1) continue;
                      var block = lane[i];
                      block.lane = laneId;
                      block.id = itemId;
                      block.chr = chrIndex;
                      block.corr_start = block.corr_start ? block.corr_start : block.start;
                      block.corr_end = block.corr_end ? block.corr_end : block.end;
                      features.push(block);
                      itemId++;
                      numItems++;
                  }
                  if (numItems > 0) {
                      lanes.push({
                          id: laneId,
                          label: lane[0].kind });
                      laneId++;
                  }
              }
              return {lanes: lanes, features: features}
            }
        
            function addFeatureTrackItems(annotations, scale) {
                var annotationsItems = annotations.append('g').selectAll('miniItems')
                    .data(featurePaths)
                    .enter().append('rect')
                    .attr('class', function (d) {
                      return d.objClass;
                    })
                    .attr('transform', function (d) {
                      return 'translate(' + d.x + ', ' + d.y + ')';
                    })
                    .attr('width', function (d) {
                      return scale(d.corr_end - d.corr_start);
                    })
                    .attr('height', featureMiniHeight)
                    .on('mouseenter', selectFeature)
                    .on('mouseleave', deselectFeature)
                    .on('click',  function(d) {
                        addTooltip(d);
                    });
                var visFeatureTexts = featurePaths.filter(function (d) {
                        if (scale(d.corr_end) - scale(d.corr_start) > 45) return d;
                });
                annotations.append('g').selectAll('miniItems')
                                    .data(visFeatureTexts)
                                    .enter().append('text')
                                    .style("font-size", "10px")
                                    .text(function (d) {
                                        var textContent = d.name ? d.name : 'ID=' + d.id;
                                        var textItemLen = scale(d.corr_end) - scale(d.corr_start);
                                        return getVisibleText(textContent, textItemLen)
                                    })
                                    .attr('class', 'featureLabel')
                                    .attr('transform', function (d) {
                                      return 'translate(' + (d.x + 3) + ', ' + (d.y + featureMiniHeight / 2 + 3) + ')';
                                    });
            }
        
            function addFeatureTrackInfo (annotations, scale) {
                annotations.append('g').selectAll('.laneLines')
                    .data(featuresData.lanes)
                    //.enter().append('line')
                    .attr('x1', 0)
                    .attr('y1', function (d) {
                        return d3.round(scale(d.id)) + .5;
                    })
                    .attr('x2', chartWidth)
                    .attr('y2', function (d) {
                        return d3.round(scale(d.id)) + .5;
                    })
                    .attr('stroke', function (d) {
                        return d.label === '' ? 'white' : 'lightgray'
                    });
        
                annotations.append('g').selectAll('.laneText')
                    .data(featuresData.lanes)
                    .enter().append('text')
                    .text(function (d) {
                        return d.label;
                    })
                    .attr('x', -10)
                    .attr('y', function (d) {
                        return scale(d.id + .5);
                    })
                    .attr('dy', '.5ex')
                    .attr('text-anchor', 'end')
                    .attr('class', 'laneText');
            }
        
            function getFeaturePaths(features) {
                var d, result = [];
                var curLane = 0;
                var numItem = 0;
        
                for (var c, i = 0; i < features.length; i++) {
                    d = features[i];
                    if (d.lane != curLane) numItem = 0;
                    c = "gene ";
                    if (INTERLACE_BLOCKS_COLOR) c += (numItem % 2 == 0 ? "odd" : "");
        
                    features[i].objClass = c;
        
                    var x = x_mini(d.corr_start);
                    var y = y_anno_mini(d.lane);
                    y += .15 * annotationMiniLanesHeight;
                    if (d.objClass.search("odd") != -1)
                        y += .04 * annotationMiniLanesHeight;
        
                    result.push({objClass: c, name: d.name, start: d.start, end: d.end, corr_start: d.corr_start, corr_end: d.corr_end,
                        id: d.id_, y: y, x: x, lane: d.lane, order: i});
                    curLane = d.lane;
                    numItem++;
                }
                return result;
            }
        
            function drawChartLanes() {
                // draw the lanes for the main chart
                main.append('g').selectAll('.laneLines')
                    .data(lanes)
                    //.enter().append('line')
                    .attr('x1', 0)
                    .attr('y1', function (d) {
                        return d3.round(y_main(d.id)) + .5;
                    })
                    .attr('x2', chartWidth)
                    .attr('y2', function (d) {
                        return d3.round(y_main(d.id)) + .5;
                    })
                    .attr('stroke', function (d) {
                        return d.label === '' ? 'white' : 'lightgray'
                    });
        
                var laneLabelOffsetX = 80 + (isContigSizePlot ? 20 : 0);
                addLanesText(main, y_main, lanes, laneLabelOffsetX, true, !isContigSizePlot);
                if (!isContigSizePlot)
                    addExpandBtns();
        
                // draw the lanes for the mini chart
                laneLabelOffsetX = 100;
                mini.append('g').selectAll('.laneLines')
                    .data(lanes)
                    //.enter().append('line')
                    .attr('x1', 0)
                    .attr('y1', function (lane) {
                        return d3.round(y_mini(lane.id)) + .5;
                    })
                    .attr('x2', chartWidth)
                    .attr('y2', function (lane) {
                        return d3.round(y_mini(lane.id)) + .5;
                    })
                    .attr('stroke', function (lane) {
                        return lane.label === '' ? 'white' : 'lightgray'
                    });
                addLanesText(mini, y_mini, lanes, laneLabelOffsetX, false, false);
            }
        
            function addLanesText(track, scale, lanes, laneLabelOffsetX, isMain, addStdoutLink) {
                track.selectAll('.laneText').remove();
                track.selectAll('.laneText')
                        .data(lanes)
                        .enter().append('text')
                        .attr('x', -10)
                        .attr('y', function (lane) {
                            var y = getExpandedLanesCount(lane.id);
                            return scale(y + (isMain ? .1 :.5));
                        })
                        .attr('dy', '.5ex')
                        .attr('text-anchor', 'end')
                        .attr('class', 'laneText')
                        .text(function(lane) { return isMain ? lane.description : lane.label; })
                        .call(wrap, laneLabelOffsetX, true, addStdoutLink, -10, /\n/);
            }
        
            function addLanesBackgrounds() {
                main.selectAll('.lane_bg')
                        .data(lanes)
                        .enter().append('rect')
                        .attr('x', 0)
                        .attr('y', function (lane) {
                            return y_main(lane.id) - 1;
                        })
                        .attr('width', chartWidth)
                        .attr('height', mainLanesHeight + 10)
                        .attr('display', 'none')
                        .attr('class', 'lane_bg');
            }
        
            function addExpandBtns() {
                var expandableLanes = [];
                for (var lanes_n = 0; lanes_n < lanes.length; lanes_n++) {
                    lane = lanes[lanes_n];
                    if (lane.maxLines > 1)
                        expandableLanes.push(lane);
                }
                d3.select('body').selectAll('.expandBtn')
                        .data(expandableLanes)
                        .enter().append('div')
                        .style('display', 'none')
                        .style('position', 'absolute')
                        .style('left', (margin.left + chartWidth + 5) + 'px')
                        .style('width', '10px')
                        .style('height', '15px')
                        .attr('class', 'expandBtn collapsedBtn btn btn-mini btn-inverse')
                        .attr('data-toggle', 'tooltip')
                        .attr('title', 'Expand overlapping blocks')
                        .html('+')
                        .on('click', function (lane) {
                            var isCollapsed = $(this).attr('class').search("collapsed") != -1;
                            //$(this).attr('collapsed', function(_, attr){ return !attr});
                            if (isCollapsed)
                                $(this).html('&minus;');
                            else $(this).html('&plus;');
                            expandLane(lane.id, isCollapsed);
                            d3.select(this).classed('collapsedBtn', !isCollapsed);
                        })
                        .on('hover', function (lane) {
                            var isCollapsed = $(this).attr('class').search("collapsed") != -1;
                            //$(this).attr('collapsed', function(_, attr){ return !attr});
                            if (isCollapsed)
                                $(this).html('&minus;');
                            else $(this).html('&plus;');
                            expandLane(lane.id, isCollapsed);
                            d3.select(this).classed('collapsedBtn', !isCollapsed);
                        });
            }
        
            function moveExpandBtns() {
                d3.select('body').selectAll('.expandBtn')
                                 .style('top', function (lane) {
                                    var y = getExpandedLanesCount(lane.id);
                                    return (y_main(y) + mainOffsetY + 3) + 'px';
                                 })
                                 .style('display', '');
            }
    </script>
</body>
